Glasgow Big Night Out

Arts Documentary hosted by Stanley Baxter, published by BBC in 2014 - English narration


Information
------------------------------

An affectionate portrait of Glasgow's rich entertainment history, featuring interviews with the stars who braved some of the toughest venues in showbusiness, alongside footage of classic performances and archive of a city that has played host to everyone from Laurel &amp; Hardy to The Beatles.

